const Auth = {
  name: "Auth",
  initialRoute: "Login",
  childs: {
    Login: { name: "Login" },
    Register: { name: "Register" },
    Home: { name: "Home" },
  },
};

const Home = {
  name: "Home",
  initialRoute: "HomePage",
  childs: {
    HomePage: { name: "HomePage" },
  },
};

const SharedScreens = {
};

const AppRoutes = {
  Home: Home,
  Auth: Auth,
  SharedScreens: SharedScreens,
};

export default AppRoutes;
